import React from 'react';
import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">

      <h1 id = "line"></h1>

      <script>
      document.getElementById('line').innerHTML = "Iam a Java Script Dom code"
      </script>
    </div>
  );
}

export default App;
